require 'pry'
def num_subarrays_with_sum(nums, goal)
  subarrays_count = 0

    condensed_nums = condense_nums(nums)
    p condensed_nums: condensed_nums
    if goal == 0
      # n = condensed_nums.first * -1
      # return (n * (n + 1)) / 2 if goal == 0 # if n = 5, arrays number == 1+2+3+4+5

      condensed_nums.select(&:negative?).map do |num|
        n = num * -1
        subarrays_count += (n * (n + 1)) / 2
      end
    end

    window = find_window(condensed_nums, 0, goal).to_i

    i = 1
    while (i + window) <= condensed_nums.size - 1
      subarrays_count += ((condensed_nums[i-1].to_i - 1) * (condensed_nums[i + window].to_i - 1))
      i += 2
    end

  subarrays_count
end

def condense_nums(nums)
  condensed_nums = []
  zero_nums = 0

  nums.each_with_index do |num, i|
    if num == 0
      zero_nums += 1
      if i == nums.size - 1
        condensed_nums << zero_nums * -1
      end
    else
      condensed_nums << zero_nums * -1
      condensed_nums << 1
      zero_nums = 0
      if i == nums.size - 1
        condensed_nums << 0
      end
    end
  end

  condensed_nums
end

def find_window(condensed_nums, i, goal)
  window = nil
  sum = 0
  for j in (i+1)..condensed_nums.size - 1 do
    next unless condensed_nums[j] == 1

    sum += condensed_nums[j]
    if sum == goal
      window = j - i
      break
    elsif sum < goal
      next
    else
      break
    end
  end

  window
end

